// src/utils/constants.js

export const SHIFTS = ['Morning', 'Noon', 'Evening', 'Night'];

export const SHIFT_TIMES = {
    Morning: '06:00-14:00',
    Noon: '10:00-18:00',
    Evening: '14:00-22:00',
    Night: '22:00-06:00',
};

export const DAYS_OF_WEEK = ['Sunday', 'Monday', 'Tuesday', 'Wednesday', 'Thursday', 'Friday', 'Saturday'];
